# @lc code=start
# Definition for singly-linked list.
import time
class ListNode:
    def __init__(self, val=0, next=None):
        self.val = val
        self.next = next

class Solution:
    def reorderList(self, head: ListNode) -> None:
        """
        Do not return anything, modify head in-place instead.
        """
        def reverseList(head: ListNode) -> ListNode:
            crt = head
            nxt = head.next
            head.next = None
            nnxt = None

            while nxt:
                nnxt = nxt.next
                nxt.next = crt
                crt = nxt
                nxt = nnxt

            return crt

        def getListLength(head: ListNode) -> int:
            length = 0
            crt = head
            while crt:
                length += 1
                crt = crt.next
            return length

        if not head or not head.next or not head.next.next:
            return

        
        # find right_part head (too slow!)
        # n = getListLength(head)
        # rightpart_head_index = n // 2 + 1
        # index = 0
        # crt = head
        # while index < rightpart_head_index - 1:
        #     index += 1
        #     crt = crt.next
        # head_of_rightpart = crt.next
        # crt.next = None
        # fast slow approach
        slow, fast = head, head.next
        while fast and fast.next:
            slow = slow.next
            fast = fast.next.next
        head_of_rightpart = slow.next
        slow.next = None
        

        # reverse right_part
        reversed_head_of_rightpart = reverseList(head_of_rightpart)

        # reorder
        crt_left = head
        crt_right = reversed_head_of_rightpart
        while crt_right:
            next_left, next_right = crt_left.next, crt_right.next
            crt_left.next = crt_right
            crt_right.next = next_left

            crt_left, crt_right = next_left, next_right
# @lc code=end
def printList(node: ListNode):
    while node is not None:
        print(node.val, end=" -> ")
        node = node.next
    print("None")

def createList(arr):
    dummy = ListNode(0)
    ptr = dummy
    for num in arr:
        ptr.next = ListNode(num)
        ptr = ptr.next
    return dummy.next


